import logo from './logo.svg';
import './App.css';
import { Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
<Routes>
<Route path="/" element={<Home />} />
        <Route path="about" element={<About />} />
</Routes>
      </header>
    </div>
  );
}

export default App;
